const Todo = ({todo, index, handleToggle, completeTodo}) => {

  const handleClick = e => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  };

  return (
      <div id={todo.id} className={todo.complete ? "todo " : "todo strike"}>
        <p>
          {todo.task}
        </p>
        <button onClick={() => completeTodo(index)}>
          Complete
        </button>
      </div>
  );
};

export default Todo;
